function finnTotaltUavgjort(aarstall, turnering, strengBool) {
     let antall_MV_elem = 6;
     let sum = 0;
     for (let i = 0; i < menyvalg.length; i++) {
          if (menyvalg[i][4 + (aarstall*antall_MV_elem)]) {
               sum += parseInt(menyvalg[i][4 + (aarstall*antall_MV_elem)].split(',')[turnering+3] || 0);
          }
     }
     if (strengBool) {
          let streng = ""
          for(let i = 0; i < turnering; i++) {
               streng += ",";
          }
          streng += sum/2;
          for(let i = 0; i < 2-turnering; i++) {
               streng += ","
          }
          return streng;
     }
     return sum/2;
}